description:
Recorded live at Gloucester Guildhall on December 15, 2012.

The band played their debut album, &quot;Schubert Dip,&quot; as well as playing fan-favourite &quot;Stigma&quot; in its entirety for the first time ever!

The DVD also includes 2 brand new songs recorded on the night, as well as band Q&amp;A session.

Multi-track audio mix and 5 HD camera shoot for superior sound and video quality.

released on February 28, 2013 as part of a pledgeMusic compaign
